import './App.css';
import Signin from './Signup/Signin';
import {Routes, Route, Router} from 'react-router-dom';
import Studentwindow from './Student/studentwindow';
import Staffwindow from './Staff/staffwindow';
import Adminwindow from './Admin/adminwindow';

function App() {
  return (
    <div className="App">
      <Router>
      <Routes>
      <Route path='*' element={<Signin/>}></Route>
      <Route path='/studentcomponent' element={<Studentwindow/>}></Route>
      <Route path='/staffcomponent' element={<Staffwindow/>}></Route>
      <Route path='/admincomponent' element={<Adminwindow/>}></Route>
      </Routes>
      </Router>
    </div>
  );
}

export default App;
